import React from "react";
// import Grid from '@material-ui/core/Grid';
import UploadItem from "./UploadItem";
import '../../ProfilePage.css'

export default class ProfileData extends React.Component {
    constructor() {
        super();
        this.state = {
            id: 1,
            uploads: [
                {id: 5, url: 'https://www.youtube.com/watch?v=apJNCcq5s6s', status: 'public'},
                {id: 4, url: 'https://www.youtube.com/watch?v=XvvYbJmA1cQ', status: 'private'},
                {id: 3, url: 'https://www.youtube.com/watch?v=O1Qh7j1yD8Y', status: 'public'},
                {id: 2, url: 'https://www.youtube.com/watch?v=y3W9Mn4beVs', status: 'public'},
                {id: 1, url: 'https://www.youtube.com/watch?v=g4wbPoWvsdo&t=69s', status: 'public'},
                {id: 0, url: 'https://www.youtube.com/watch?v=Eb5dsG7L7lo', status: 'public'},
            ]
        }

    }

    render() {
        return (
            <div className={'uploadsContainer'}>
                {this.state.uploads.map((upload) => (
                    <UploadItem key={upload.id} uploadURL={upload.url} status={upload.status}/>
                ))}
            </div>
        )
    }
};
